TRUNCATE TABLE pim_inventory RESTART IDENTITY;

-- Insert batch #1

-- RESET ESTABLISHMENTS PK AND SEQUENCE COUNT
SELECT MAX(id) pim_inventory_max_id FROM pim_inventory;
SELECT nextval('pim_inventory_id_seq') AS pim_inventory_nextval;
SELECT setval('pim_inventory_id_seq', (SELECT MAX(id) FROM pim_inventory)) AS pim_inventory_setval;
SELECT setval('pim_inventory_id_seq', COALESCE((SELECT MAX(id)+1 FROM pim_inventory), 1), false) AS pim_inventory_val;
